(84469,	2571,	'eng',	'n',	NULL,	'Region. field.',	'ခန်လွာဍုၚ်မန် = မွန်နယ်ပယ်။ မွန်ပြည်နယ်။ ခန်လွာမၞိဟ် = လူ့ရပ်ရွာ။ လူ့ရပ်ဋ္ဌာနေ။ “ယွံသုမုခ၊ ဋ္ဌာန်ခန်လွာမၞိဟ်တေံဂှ် မၞိဟ်တံဂှ် မၞုံကဵုဥပ္ပါဲဂၠိုၚ်သန်” ဗောဓိသတ်(သၟိၚ်ၜိုပ်ထဝ်)ဂး။ (ဇ—၅၃၄။ အစွောံ။) = “(ဟၚ်္သာစစ်သူကြီး)သုမုခ၊ လူ့ရပ်ရွာ ဋ္ဌာနေ­ လူတို့သည် များသောဥပါယ်တံမျဉ်ရှိကုန်၏” ဟုရွှေဟၚ်္သာမင်းဆို၏။ || “သၟိၚ်မပိုၚ်ဇမ္မု ဒိတ်ဂှ် ကလိဂွံကောန်တြုံစှ်၊ ပ္ဍဲတ္ကအ်ဇမ္မုဒိတ် ပစှ်စွံ ပရအ်ကဵုကောန်တြုံစှ်ဂှ်။ — (ကောကဵုဒေံတံ ဂှ်) လအ်ညိအယုက်ဇၞော် အာဟွံဒှ်ရ။ အဲဒၟံၚ်ခန်လွာအဲ ညးဒၟံၚ်ခန်လွာညးရ။” (ဓမ္မသာတ်။ MDT VII-1) = “ဇမ္ဗူဒိပ်ကိုပိုၚ်သောမင်းသည် သားယောကျာ်းဆယ်ယောက်ရ၏။ ဇမ္ဗူဒိပ်ကျွန်းကို ဆယ်စုခွဲ၍ သားဆယ်ယောက်တို့ကို ဝေငှပေး၏။ ထိုညီနောင်တို့သည် ကာ လကြာလတ်သော် အသက်ကြီး၍ မသွားနိုင်ကြတော့။ မိမိတို့၏နယ်ပယ်များ­သာ တသီးတခြား နေကြကုန်၏။”',	'2025-10-27 00:43:54',	7),
