(84480,	2573,	'eng',	'v',	NULL,	'(Military force) prepared. collected. Collected. gather.',	'ညးစှ် ကောကဵုဒေံ ခါန်ကေတ်ဗဵုလဗးတုဲ “ပ္ဍဲဂၠးဇမ္ဗုဒိပ်ဝွံ ပိုဲအာဗတိုက်ကေတ်ညိ” ဂးတုဲ ဇက်တိတ်အာ နူဍုၚ်ရ။ (ဇ—၄၅၄။ အစွောံ။) = ထိုတစ်ကျိပ်သော မင်းညီနောင်တို့သည် စစ်တပ်ဗိုလ်ပါအၚ် အားစုစည်း၍ “ဇမ္ဗူဒိပ်ကျွန်းအလုံးကို တိုက်ယူကုန်အံ့” ဟု မြို့မှထွက်ချီကြကုန်၏။ || “သၟိၚ် ကဵုခါန်မၞိဟ် သီုလွဟ်ဗၞုဟ်သ္ဇၚ်တုဲ ဗိုၚ်စၠောံလဝ်သုသာန် ဋ္ဌာန်ကလော်ဒမြိုဟ်ဂှ်ရ။” (ဇ—၅၁၃။ အစွောံ။) = “မင်းသည် လူများကိုစုရုံးစေပြီးလျှင် ဓါးလှံလက်နက်များနှင့်တကွ ထိုဘီလူးဆိုးရှိ ရာသုသာန်ကို ဝန်းရံစေ၏။”',	'2025-10-27 00:44:30',	7),
